import React from "react";
import { Row, Col } from "react-bootstrap";

import PicOne from '../../Assests/Images/aboutUs/team1.jpg';

import Heading from "../Heading";

function Team() {
  return (
    <Row>
      <Col sm={12} className="mx-auto" id="team">
          <Heading content="Our Teams" design="fw-bold fs-5 bg-info text-white rounded text-center mb-3" />
          <Row className="d-flex flex-wrap mx-auto">
<img src={PicOne} alt="Zom-IN teams" className=" w-50 my-2" />
<img src={PicOne} alt="Zom-IN teams" className="w-50 my-2" />
<img src={PicOne} alt="Zom-IN teams" className="my-2" />
          </Row>
      </Col>
    </Row>
  );
}

export default Team;
